import React, { Component } from 'react'
import Education from './components/Education'
import Identity from './components/Identity'
import Skills from './components/Skills'
import Work from './components/Work'
import "./App.css"


export default class App extends Component {
constructor(props){
  super(props)
  this.state = {
    name: "",
    surname: "",
    schoolname: "",
    schoolstartdate: "",
    schoolfinishdate: "",
    workedas: "",
    startdate: "",
    finishdate: "",
    description: ""

  }

}

/* PROPS REGARDING IDENTITY */

getName = (identityName) =>{
  console.log(identityName)
  this.setState({
    name: identityName
  })
}

getSurname = (identitySurname) =>{
  console.log(identitySurname)
  this.setState({
    surname: identitySurname
  })
}


consoleLog = () =>{
  console.log(this.state.name)
  console.log(this.state.surname)
  console.log(this.state.schoolname)
  console.log(this.state.schoolstartdate)
  console.log(this.state.schoolfinishdate)
}

/* ------------------- */

/* PROPS REGARDING EDUCATION */

getSchoolName = (educationSchoolName) =>{
  console.log(educationSchoolName)
  this.setState({
    name: educationSchoolName
  })
}

getSchoolStartDate = (educationSchoolStartDate) =>{
  console.log(educationSchoolStartDate)
  this.setState({
    name: educationSchoolStartDate
  })
}

getSchoolFinishDate = (educationSchoolFinishDate) =>{
  console.log(educationSchoolFinishDate)
  this.setState({
    name: educationSchoolFinishDate
  })
}


/* ---------------------- */

  render() {
    return (
      <div className='container'>
        <Identity getNameFunction={this.getName} getSurnameFunction={this.getSurname}/>
        <Education  getSchoolNameFunction={this.getSchoolName} getSchoolStartDateFunction={this.getSchoolStartDate} getSchoolFinishDateFunction={this.getSchoolFinishDate}/>
        <Work/>
        <Skills/>
        <button onClick={this.consoleLog}>See</button>

      </div>
    )
  }
}
